func countCompleteSubstrings(word string, k int) int {
    var count int
    for start := 0; start < len(word); start++ {
        freq := make(map[rune]int)
        distinct := 0
        for end := start; end < len(word); end++ {
            char := rune(word[end])
            if freq[char] == 0 {
                distinct++
            }
            freq[char]++
            if freq[char] > k {
                break
            }
            if distinct <= 3 && end-start+1 >= k*distinct && checkCompleteSubstring(freq, k) {
                count++
            }
        }
    }
    return count
}

func checkCompleteSubstring(freq map[rune]int, k int) bool {
    minChar, maxChar := 'z'+1, 'a'-1
    for char, count := range freq {
        if count != k {
            return false
        }
        if char < minChar {
            minChar = char
        }
        if char > maxChar {
            maxChar = char
        }
    }
    return maxChar-minChar <= 2
}
